// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HousekeepingDashboard from './HousekeepingDashboard';
import ReservationForm from './ReservationForm';
import ReservationList from './ReservationList';
import EditReservation from './EditReservation';
import RoomAvailability from './RoomAvailability';
import SummaryDashboard from './SummaryDashboard';
import ExportData from './ExportData';
import CleaningTasksList from './CleaningTasksList';
import UpcomingCleaningTasks from './UpcomingCleaningTasks';

function App() {
  return (
    <Router>
      <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
        {/* Management Port Section */}
        <div style={{ marginBottom: '20px' }}>
          <h3>Reservation Management</h3>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li><Link to="/reservations">Reservation Management</Link></li>
            <li><Link to="/reservation-list">Reservation List</Link></li>
            <li><Link to="/room-availability">Room Availability</Link></li>
            <li><Link to="/summary">Summary Dashboard</Link></li>
            <li><Link to="/export-data">Export Data</Link></li>
          </ul>
        </div>
        {/* AFC Housekeeping Ministry Dashboard Section */}
        <div style={{ marginBottom: '20px' }}>
          <h3>AFC Housekeeping Ministry Dashboard</h3>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li><Link to="/">Housekeeping Ministry Chart</Link></li>
            <li><Link to="/cleaning-tasks">Cleaning Tasks</Link></li>
            <li><Link to="/upcoming-tasks">Upcoming Cleaning Tasks</Link></li>
          </ul>
        </div>
        <hr />
        <Routes>
          <Route path="/" element={<HousekeepingDashboard />} />
          <Route path="/reservations" element={<ReservationForm />} />
          <Route path="/reservation-list" element={<ReservationList />} />
          <Route path="/room-availability" element={<RoomAvailability />} />
          <Route path="/summary" element={<SummaryDashboard />} />
          <Route path="/export-data" element={<ExportData />} />
          <Route path="/cleaning-tasks" element={<CleaningTasksList />} />
          <Route path="/upcoming-tasks" element={<UpcomingCleaningTasks />} />
          <Route path="/edit-reservation/:id" element={<EditReservation />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
